import React, { Component } from "react";

import NavigationBar from '../medium/navbar';
import ContentPromo from '../medium/contentpromo';
import ContentBox from '../medium/contentbox';
import NavBarBottom from '../medium/navbarbottom';


class Home extends Component {
  render() {
     return (
     <div>
       <NavigationBar/>
       <NavBarBottom/>
       <ContentPromo/>
       <ContentBox/>
     </div>
     );
  }
}

export default Home;
